import React, { useEffect, useRef } from 'react';
import { init } from "ityped";
import '../styles/Home.css';
import { motion } from 'framer-motion';
import { Container, Typography, Link, Grid, Box } from '@mui/material';
import BlueMoon from "../assets/BlueMoon.png";
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles((theme) => ({
  container: {
    flex: 1,
    display: 'flex',
    justifyContent: 'flex-start',
    marginTop: theme.spacing(1),
    marginLeft: theme.spacing(2),
    [theme.breakpoints.up('sm')]: {
      marginTop: theme.spacing(3.5),
      marginLeft: '-17vh',
    },
    [theme.breakpoints.up('md')]: {
      marginLeft: '-26vh',
    },
    [theme.breakpoints.up('lg')]: {
      marginTop: theme.spacing(2.5),
    },
    [theme.breakpoints.up('xl')]: {
      marginTop: 0,
    },
  },
  text: {
    fontWeight: 'bold',
    fontSize: '20px',
    lineHeight: 'normal',
    maxWidth: 'sm',
    color: '#fff',
    textAlign: 'left',
    [theme.breakpoints.up('sm')]: {
      fontSize: '30px',
      lineHeight: '40px',
    },
    [theme.breakpoints.up('md')]: {
      fontSize: '36px',
      lineHeight: '50px',
    },
    [theme.breakpoints.up('xl')]: {
      fontSize: '46px',
      lineHeight: '60px',
      maxWidth: 'lg',
    },
  },
}));


function Home() {
    const textRef = useRef();

  // useEffect(() => {
  //   init(textRef.current, {
  //     loop: true,
  //     showCursor: true,
  //     backSpeed: 100,
  //     startDelay: 120,
  //     backDelay: 1700,
  //     strings: ["Student", "Developer", "Wonderer"],
  //   });
  // }, []);

  const path = "M0,100 Q50,50 100,100 Q150,150 200,100";

  return (
      <Container className="header" sx={{ flexGrow: 6 }}>
        <Grid container >
          <Grid item>
            <Container className="moon">
              <motion.img
                className="moon"
                src={BlueMoon}
                alt="moon"
                animate={{ path: path }}
                transition={{ duration: 20, repeat: Infinity }}
              />
            </Container>
          </Grid>

          {/* <Grid item>
            <Typography  id="phrase" variant='h1'>
              A Sense of Wonder in A World Gone Mad
            </Typography>
          </Grid> */}

        </Grid>
      </Container>
  );
}

export default Home;
